import "./Heroimage2style.css";
import herobackground from "../assets/prof2.jpg";

const Heroimage2 = () => {
  return (
    <div className="hero-image">
      <div className="mask">
        <img className="Herobg" src={herobackground} alt="heroimage" />
      </div>

      <div className="heading">
        <h1>This is heading</h1>
        <p>this is paraw</p>
      </div>
    </div>
  );
};

export default Heroimage2;
